import React from 'react';
import './StartScreen.css';

function StartScreen({ onStart }) {
  return (
    <div className="start-screen">
      <div className="content">
        <h1>마약 예방 교육 센터</h1>
        <button className="start-button" onClick={onStart}>
          시작하기
        </button>
      </div>
    </div>
  );
}

export default StartScreen;
